import React from 'react';
import { Button, Col, Container, Form, FormInput, Row } from 'shards-react';

const Home = () => {
    return (
        <Container>
            <Row>
                <Col>
                    <Form>
                        <FormInput style={{ marginBottom: 5 }} placeholder="My form input" />
                        <Button theme="secondary">Secondary</Button>
                    </Form>
                </Col>
            </Row>
        </Container>
    )
}

export default Home;
